import React from 'react';
import img1 from '../public/Images/img1.png';
const Home = ()=>{
    return(
        <>
       <div className='mt-5'>
        <div className="container">
            <img src={img1} alt='img1..'/>
        </div>
       </div>
        
        </>
    );
};
export default Home;
